// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.28;

import {Ownable} from "./Helpers/Ownable.sol";
import {ERC20} from "./ERC20/ERC20.sol";

interface RewardsToken {
    function rewardPoints(address target, uint256 amount) external;
    function redeemPoints(uint256 amount) external payable;
}

abstract contract BaseLoyaltyToken is ERC20, Ownable, RewardsToken {
    error IneligibleUser();

    event Rewarded(address indexed _from, address indexed _to, uint256 _value);
    event Redeemed(address indexed _owner, uint256 _value);

    string public name;
    string public symbol;
    uint8 immutable public decimals;
    uint256 public totalSupply;
    uint256 immutable public minReward;

    mapping(address => uint256) public holders;
    mapping(address => bool) public partners;

    // MARK: - Modifiers
    modifier _validateAccount(address target) virtual {
        require(target != address(0), "Invalid Target Address");
        _;
    }

    modifier _validateAmount(uint256 amount) virtual {
        require(amount >= minReward, "Transfer Amount needs to be at least equal to the minimum Reward");
        _;
    }

    modifier onlyPartner virtual {
        if (partners[msg.sender] == false) { revert UnauthorizedAccess(); } 
        _;
    }

    // MARK: - Internal
    function _authorizeReward(address target) internal view virtual;

    // MARK: - Public
    function balanceOf(address _owner) _validateAccount(_owner) external view returns (uint256 balance) {
        return holders[_owner];
    }

    function transfer(address _to, uint256 _value) _validateAccount(_to) _validateAmount(_value) external returns (bool success) {
        holders[msg.sender] -= _value;
        holders[_to] += _value;

        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function addPartner(address target) onlyOwner _validateAccount(target) public virtual {
        partners[target] = true;
    }

    function removePartner(address target) onlyOwner _validateAccount(target) public virtual {
        partners[target] = false;
    }
}

contract BrewBeanPointsToken is BaseLoyaltyToken {
    constructor(string memory _name, string memory _symbol, uint8 _decimals, address _owner, uint256 _minReward) Ownable(_owner) payable {
        name = _name;
        _symbol = _symbol;
        decimals = _decimals;
        minReward = _minReward;
    }

    // MARK: - Internal
    function _authorizeReward(address target) internal view override {
        if (partners[target] == true) { revert UnauthorizedAccess(); } 
        if (holders[target] <= (95 ether)) { revert IneligibleUser(); } // arbitrary checks
    }
    
    // MARK: - Public
    function rewardPoints(address target, uint256 amount) onlyPartner _validateAccount(target) _validateAmount(amount) public virtual {
        _authorizeReward(target);

        totalSupply += amount;
        holders[target] += amount;

        emit Rewarded(address(0), target, amount);
    }

    function redeemPoints(uint256 amount) _validateAccount(msg.sender) _validateAmount(amount) public payable virtual {
        _authorizeReward(msg.sender);

        if(holders[msg.sender] < amount) { revert InsuficientBalance(); }

        holders[msg.sender] -= amount;
        totalSupply -= amount;

        emit Redeemed(msg.sender, amount);
    }
}

